export default class ListingTodoModel {
    listingTitle?: string = "Dummy"
    isStriked:boolean = false

    constructor(listingTitle:string){
        this.listingTitle = listingTitle
    }

     toJson(){
        return {
            "listingTitle":this.listingTitle,
            "isStriked":this.isStriked
        }
    }

    static convertJsonArrayToModel(array:Array){
        let list:ListingTodoModel[] = new Array() 
        array.forEach(e=>{
            let model = new ListingTodoModel(e.listingTitle)
            list.push(model)
        })
        return list
    }
}
